import Hello from './components/hello';
import React from 'react';

function App(){
    return <div className="App">
        <Hello name="Othmane"></Hello>
        <Hello name="Yanis"></Hello>
        <Hello name="Maxime"></Hello>
        <Hello name="Miqdad"></Hello>
        <></>
    </div>;
}
export default App;
